  let no = 1;
  return (
    <table class="table table-bordered">
      <tr>
        <th>No</th>
        <th>Name</th>
        <th>Email</th>
      </tr>
      {
        data.map((post) => (
          <tr>
            <>
              <td>{no++}</td>
              <td>{post.first} {post.last}</td>
              <td>{post.email}</td>
            </>
          </tr>
        ))
      }
    </table >

  )
}

